    "description" : "Gunakan bidang ini untuk kata-kata yang digunakan untuk menyebut kata-kata kotor yang berkaitan dengan seks, kenajisan, kematian, kutukan, pantangan dan larangan atau perkara-perkara yang tidak sopan. Penting untuk memeriksa ketepatan kata-kata kotor ini di dalam kamus. Penutur bahasa itu sendirilah yang harus menentukan apakah kata-kata tertentu perlu dimasukkan atau tidak. Kata-kata kotor yang dimasukkan ke dalam kamus ini harus diterangkan secara jelas. Kata-kata kotor sering digunakan untuk meninggikan atau menambah penekanan nada pembicaraan seseorang, terutama ketika seseorang sedang marah. Kata-kata kotor sering dikaitkan dengan seks atau kenajisan. Kutuk juga sering dikaitkan dengan Tuhan, agama, atau kehidupan setelah kematian. Kata-kata yang yang bertujuan untuk merendahkan seseorang sering menyamakan manusia dengan binatang yang wataknya tidak disukai, mempertanyakan asal-usul/hak kekuasaan seseorang, mempertanyakan watak seseorang, ataupun mempertanyakan tingkat kecerdasan atau kesehatan jiwa seseorang.",
