    "abbr" : "4.9.3.1",
    "name" : "Tulisan-tulisan suci",
    "description" : "Gunakan bidang ini untuk kata-kata yang berhubungan dengan tulisan-tulisan suci. Contoh yang diberikan di sini hanya untuk tulisan-tulisan suci dalam agama Kristen. Namun demikian, sebaiknya masukkan kata-kata yang digunakan untuk menyebut kitab suci dari semua agama.",
