    "key" : "4.9.4.2",
    "abbr" : "4.9.4.2",
    "name" : "Kerasukan setan",
    "description" : "Gunakan bidang ini untuk kata-kata yang digunakan untuk menyebut kerasukan setan, ketika seseorang berada di bawah kuasa atau pengaruh setan atau roh jahat. Gunakan bidang ini untuk semua kata yang berkaitan dengan hubungan antara roh dan manusia, termasuk komunikasi antara manusia dan roh, serta semua kata yang digunakan untuk menyebut tindakan mengusir setan--menghentikan pengaruh atau kuasa setan atas seseorang.",
