    "abbr" : "7",
    "name" : "Gerakan fisik",
    "description" : "Gunakan bidang ini untuk kata-kata umum untuk gerakan fisik, yaitu menggerakkan diri sendiri, menggerakkan sesuatu, dan mengubah sesuatu.",
