    "name" : "Bergerak",
    "description" : "Gunakan bidang ini untuk kata-kata kerja intransitif (tidak diikuti oleh objek atau pelengkap) tentang pergerakan yang digunakan untuk menyebut tindakan menggerakkan seluruh anggota tubuh yang berbeda. Ada banyak unsur makna yang terdapat pada kata kerja tentang pergerakan ini. Kata kerja yang dimaksud bisa mencakup tempat sumber (dari), tempat tujuan (ke), jalan (sepanjang), cara bergerak (berlari, berjalan), kecepatan (berlari, merangkak), arah (ke depan, ke belakang, ke samping, ke atas, ke bawah, menuju, menjauh dari), bentuk jalan (lurus, belok, melingkar, membelok), hubungan beberapa atau banyak objek (di, bergantung, berlawanan, di antara, berseberangan, melalui, ke dalam, dari, ke atas, di luar, sekitar), dekatnya (dekat, jauh), beraneka ragam gerakan (maju dan mundur, kembali, mental), hubungan antara banyak objek atau bagian-bagian dari objek tertentu (bergabung, meninggalkan, berkumpul, bubar, bersatu, berpisah), kemauan (lurus atau belok), intransitif atau transitif (bergerak atau menggerakkan sesuatu). Beberapa kata kerja tentang pergerakan ini tidak mencakup hal bergerak dari satu tempat ke tempat lain, tetapi mengungkapkan cara tubuh bergerak.",
