    "name" : "Menciptakan",
    "description" : "Gunakan bidang ini untuk kata-kata yang digunakan untuk menyebut menciptakan sesuatu, yaitu menyebabkan sesuatu (yang tadinya tidak ada) menjadi ada.",
    "value" : "9.1.2.3 Menciptakan"
