    "name" : "Kasatmata, tidak kasatmata",
    "description" : "Gunakan bidang ini untuk kata-kata yang menjelaskan sifat sesuatu yang kasatmata, yaitu yang dapat disentuh dan dilihat, dan sifat sesuatu yang tidak kasatmata, yaitu yang tidak dapat disentuh dan dilihat.",
    "value" : "9.1.3.1 Kasatmata, tidak kasatmata"
