    "abbr" : "9.2.3.2",
    "name" : "Kata ganti tak tentu",
    "description" : "Gunakan bidang ini untuk kata ganti yang tidak mengacu kepada orang atau benda tertentu, tetapi bisa mengacu kepada siapa saja atau apa saja. Beberapa bahasa mungkin tidak memiliki semua kumpulan kata ganti yang dijelaskan di bawah ini. Tambahkan ke dalam tabel daftar kata ganti, jika ada kata ganti lain yang ditemukan dalam bahasa yang kita kerjakan.",
    "value" : "9.2.3.2 Kata ganti tak tentu"
