    "name" : "Preposisi (kata depan), post-posisi (kata depan yang terletak di belakang kata benda yang diterangkan)",
    "description" : "Gunakan bidang ini untuk mendaftarkan semua preposisi (kata depan) dan post-posisi (kata depan yang terletak di belakang kata benda yang diterangkan). Catatan: bahasa tertentu memiliki kata depan yang terletak di belakang kata benda yang diterangkan, misalnya dalam bahasa Jepang, Tokyo ni, artinya di Tokyo)",
