    "key" : "9.2.9.3",
    "abbr" : "9.2.9.3",
    "name" : "Kata imbuhan derivatif",
    "description" : "Gunakan bidang ini untuk mendaftar semua kata imbuhan derivatif. Kata imbuhan derivatif digabungkan dengan kata dasar dan menimbulkan satu kata baru. Kata imbuhan derivatif biasanya mengubah kata dasar sehingga kata tersebut menjadi jenis kata yang berbeda. Menambahkan kata imbuhan derivatif biasanya sangat mengubah makna kata dasar itu.",
