    "abbr" : "9.3.3",
    "name" : "Sebagian",
    "description" : "Gunakan bidang ini untuk kata-kata yang digunakan untuk menyebut tingkatan yang hanya sebagian dan belum menyeluruh, yaitu ketika sesuatu dilakukan, terjadi, dipikirkan, atau dirasakan hanya sebagian dan hanya dalam waktu atau cara tertentu.",
