    "name" : "Konstituen atau unsur semantik yang berkaitan dengan kata kerja",
    "description" : "Gunakan bagian ini untuk kata kerja bantu, kata imbuhan, kata keterangan, dan partikel yang menjelaskan kata kerja.",
