  "9.5" : {
    "guid" : "aab82dc7-de9f-44b3-845e-0c926f47cfb6",
    "key" : "9.5",
    "abbr" : "9.5",
    "name" : "Kasus linguistik",
    "description" : "Setiap kata kerja memiliki sekumpulan hubungan kasus semantik (bukan kasus hukum). Misalnya dalam kalimat 'Ia memberi bunga kepadamu', kata kerjanya memberikan tiga hubungan kasus. 'Ia' adalah subjek pelaku, 'bunga' adalah objek penderita, dan 'mu' adalah 'penerima'. Dalam konteks ini, kalimat 'Mu memberi bunga kepada ia' tidak bisa digunakan karena kasusnya tidak tepat. Bahasa Inggris menandai hubungan kasus dengan beberapa jenis kata ganti orang, misalnya 'I', 'me' dan 'my' adalah tiga kasus berbeda yang memiliki arti yang sama, yaitu 'saya'. Beberapa bahasa menandai hubungan kasus dengan menggunakan beberapa jenis kata ganti orang, imbuhan, kata depan (preposisi), kata depan yang letaknya di belakang kata benda (post-posisi), dan kadang-kadang menggunakan kata kerja khusus. Untuk bisa sepenuhnya menjelaskan suatu bahasa, setiap kata kerja harus diselidiki, semua hubungan kasusnya harus dikenali, dan segala cara menandai hubungan ini harus dijelaskan. Karena biasanya kata kerja bersifat unik dan tidak terprediksi hubungan kasusnya, maka kita harus mencari informasinya di dalam kamus. Bagian ini sebaiknya digunakan untuk menggolongkan kata-kata dan imbuhan yang digunakan untuk menandai hubungan kasus. Bidang ini sebaiknya digunakan untuk istilah-istilah teknis yang digunakan untuk menyebut hubungan kasus.",
    "value" : "9.5 Kasus linguistik"
  },
