    "abbr" : "9.5.1.1",
    "name" : "Pemeroleh dalam suatu kejadian",
    "description" : "Gunakan bidang ini untuk kata-kata yang menandai objek pemeroleh dalam suatu kejadian. Kalimat \"John membangun rumah untuk ayahnya\" memiliki dua arti. Jika rumah tersebut dibangun untuk tempat tinggal ayah John, maka kata 'untuk' digunakan untuk menandai 'Pemeroleh dari objek penderita', yang berarti bahwa rumah itu memang untuk ayahnya. Akan tetapi sebaliknya, jika ayahnya bermaksud membangun rumah untuk dijual, namun dia tidak mampu melakukannya karena terjadi suatu hal, maka kata \"untuk\" di sini akan menandai 'Pemeroleh dalam suatu kejadian', yang berarti ayahnya akan mendapatkan keuntungan dari rumah yang dibangun itu.",
