    "name" : "Pemeroleh (dari objek penderita)",
    "description" : "Gunakan bidang ini untuk kata-kata yang menandai pemeroleh dari objek penderita karena suatu kejadian. Objek penderita biasanya dinyatakan sebagai objek suatu kalimat. Dalam kalimat \"John membangun rumah untuk orang tuanya\", kata rumah adalah objek penderita. Rumahlah yang memberikan keuntungan kepada orang tua John, bukan proses pembangunan rumahnya.",
